import React, { useEffect, useRef, useState } from 'react';
import io from 'socket.io-client';
import Peer from 'simple-peer';
import './App.css';

const socket = io('http://localhost:3001');

function App() {
  const localVideoRef = useRef(null);
  const remoteVideoRef = useRef(null);
  const [callStarted, setCallStarted] = useState(false);
  const [isMuted, setIsMuted] = useState(false);
  const [comment, setComment] = useState('');
  const [comments, setComments] = useState([]);
  const [username, setUsername] = useState('');
  const [channel, setChannel] = useState('');

  const peer = new Peer({ initiator: false, trickle: false });

  useEffect(() => {
    navigator.mediaDevices
      .getUserMedia({ video: true, audio: true })
      .then((stream) => {
        localVideoRef.current.srcObject = stream;

        // Send the stream to the peer
        peer.addStream(stream);

        // Set up listeners for WebRTC events
        peer.on('signal', (data) => {
          socket.emit('offer', data);
        });

        socket.on('answer', (data) => {
          peer.signal(data);
        });

        socket.on('ice-candidate', (data) => {
          peer.signal(data);
        });

        // Make an initial connection to the server
        socket.emit('join', { username: 'YourUsername', channel: 'YourChannel' });
      })
      .catch((error) => console.error('Error accessing local media:', error));

    // Set up listeners for WebRTC events
    socket.on('offer', (offer) => {
      peer.signal(offer);
    });

    return () => {
      // Disconnect from the peer and close the connection
      peer.destroy();
    };
  }, []);

  // Set up listeners for WebRTC events
  peer.on('stream', (remoteStream) => {
    remoteVideoRef.current.srcObject = remoteStream;
  });

  // Handle incoming comments
  socket.on('comment', (commentData) => {
    setComments((prevComments) => [...prevComments, commentData]);
  });

  // Function to send comments
  const sendComment = () => {
    if (comment.trim() !== '') {
      socket.emit('comment', { username, channel, text: comment });
      setComment('');
    }
  };

  // Function to toggle mute/unmute
  const toggleMute = () => {
    const audioTracks = localVideoRef.current.srcObject.getAudioTracks();
    audioTracks.forEach((track) => (track.enabled = !track.enabled));
    setIsMuted((prev) => !prev);
  };

  // Function to initiate/terminate the call
  const toggleCall = () => {
    if (callStarted) {
      peer.destroy();
      setCallStarted(false);
    } else {
      socket.emit('initiateCall', { username, channel });
      setCallStarted(true);
    }
  };

  return (
    <div className="video-call-container">
      <div className="video-box">
        <video ref={localVideoRef} autoPlay muted className="local-video"></video>
        <div className="local-username">You</div>
        <div className="control-buttons">
          <button onClick={toggleMute}>{isMuted ? 'Unmute' : 'Mute'}</button>
          <button onClick={toggleCall}>{callStarted ? 'End Call' : 'Start Call'}</button>
        </div>
      </div>

      <div className="video-box">
        <video ref={remoteVideoRef} autoPlay className="remote-video"></video>
        <div className="remote-username">Remote User</div>
      </div>

      <div className="comment-section">
        <div className="comments">
          {comments.map((commentData, index) => (
            <div key={index} className="comment">
              <span className="comment-username">{commentData.username}:</span> {commentData.text}
            </div>
          ))}
        </div>
        <div className="comment-input">
          <input
            type="text"
            placeholder="Type your comment"
            value={comment}
            onChange={(e) => setComment(e.target.value)}
          />
          <button onClick={sendComment}>Send</button>
        </div>
      </div>
    </div>
  );
}

export default App;
